import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      <div class="input-group">

  <input type="text" class="form-control" placeholder="Username" aria-label="Username" aria-describedby="addon-wrapping">
    </input>
        </div>
    </header>
    </div>
  );
}

export default App;
